            <div className={`column${Math.floor(index / 8)} bg-slate-500 w-4`} >
              <Note note={note} index={index} column={Math.floor(index / 8)} playList0={playList1} playList2={playList2} playList0={playList0} arraysLists={arraysLists}/>
            </div>
          ))
        }

      </>
    )
}

export default notes
